func (v GoogleValue) IsNull() bool {
	return v.state == attr.ValueStateNull
}

func (v GoogleValue) IsUnknown() bool {
	return v.state == attr.ValueStateUnknown
}

func (v GoogleValue) String() string {
	return "GoogleValue"
}

func (v GoogleValue) ToObjectValue(ctx context.Context) (basetypes.ObjectValue, diag.Diagnostics) {
	var diags diag.Diagnostics

	attributeTypes := map[string]attr.Type{
		"client_id":     basetypes.StringType{},
		"client_secret": basetypes.StringType{},
		"config_type":   basetypes.StringType{},
		"hosted_domain": basetypes.StringType{},
		"redirect_uri":  basetypes.StringType{},
		"refresh_token": basetypes.BoolType{},
		"user_ip":       basetypes.BoolType{},
	}

	if v.IsNull() {
		return types.ObjectNull(attributeTypes), diags
	}

	if v.IsUnknown() {
		return types.ObjectUnknown(attributeTypes), diags
	}

	objVal, diags := types.ObjectValue(
		attributeTypes,
		map[string]attr.Value{
			"client_id":     v.ClientId,
			"client_secret": v.ClientSecret,
			"config_type":   v.ConfigType,
			"hosted_domain": v.HostedDomain,
			"redirect_uri":  v.RedirectUri,
			"refresh_token": v.RefreshToken,
			"user_ip":       v.UserIp,
		})

	return objVal, diags
}

func (v GoogleValue) Equal(o attr.Value) bool {
	other, ok := o.(GoogleValue)

	if !ok {
		return false
	}

	if v.state != other.state {
		return false
	}

	if v.state != attr.ValueStateKnown {
		return true
	}

	if !v.ClientId.Equal(other.ClientId) {
		return false
	}

	if !v.ClientSecret.Equal(other.ClientSecret) {
		return false
	}

	if !v.ConfigType.Equal(other.ConfigType) {
		return false
	}

	if !v.HostedDomain.Equal(other.HostedDomain) {
		return false
	}

	if !v.RedirectUri.Equal(other.RedirectUri) {
		return false
	}

	if !v.RefreshToken.Equal(other.RefreshToken) {
		return false
	}

	if !v.UserIp.Equal(other.UserIp) {
		return false
	}

	return true
}

func (v GoogleValue) Type(ctx context.Context) attr.Type {
	return GoogleType{
		basetypes.ObjectType{
			AttrTypes: v.AttributeTypes(ctx),
		},
	}
}

func (v GoogleValue) AttributeTypes(ctx context.Context) map[string]attr.Type {
	return map[string]attr.Type{
		"client_id":     basetypes.StringType{},
		"client_secret": basetypes.StringType{},
		"config_type":   basetypes.StringType{},
		"hosted_domain": basetypes.StringType{},
		"redirect_uri":  basetypes.StringType{},
		"refresh_token": basetypes.BoolType{},
		"user_ip":       basetypes.BoolType{},
	}
}
